(4531, 'P30464', '1B15_HUMAN', '1993-04-01', '2014-02-19', 'Eukaryota', '362 AA', ' Evidence at protein level;\r\n', ' Membrane; Single-pass type I membrane\r\n protein.\r\n-!- PTM: Polyubiquitinated in a post ER compartment by interaction\r\n with human herpesvirus 8 MIR1 protein. This targets the protein\r\n for rapid degradation via the ubiquitin system (By similarity).\r\n-!- POLYMORPHISM: The following alleles of B-15 are known: B*15:01\r\n (Bw-62; B-62), B*15:02 (Bw-75, B-75), B*15:03 (Bw-72; B-72; B-70)\r\n B*15:04, B*15:11, B*15:19 and B*15:66. The sequence shown is that\r\n of B*15:01.\r\n-!- DISEASE: Stevens-Johnson syndrome (SJS) [MIM:608579]: A rare\r\n blistering mucocutaneous disease that share clinical and\r\n histopathologic features with toxic epidermal necrolysis. Both\r\n disorders are characterized by high fever, malaise, and a rapidly\r\n developing blistering exanthema of macules and target-like lesions\r\n accompanied by mucosal involvement. Stevens-Johnson syndrome is a\r\n milder disease characterized by destruction and detachment of the\r\n skin epithelium and mucous membranes involving less than 10% of\r\n the body surface area. Ocular symptoms include ulcerative\r\n conjunctivitis, keratitis, iritis, uveitis and sometimes\r\n blindness. It can be caused by a severe adverse reaction to\r\n particular types of medication, although Mycoplasma infections may\r\n induce some cases. Note=Disease susceptibility is associated with\r\n variations affecting the gene represented in this entry. Increased\r\n susceptibility to Stevens-Johnson syndrome is conferred by allele\r\n B*15:02.\r\n-!- SIMILARITY: Belongs to the MHC class I family.\r\n-!- SIMILARITY: Contains 1 Ig-like C1-type (immunoglobulin-like)\r\n domain.\r\n', 'MRVTAPRTVLLLLSGALALTETWAGSHSMRYFYTAMSRPGRGEPRFIAVGYVDDTQFVRF\r\nDSDAASPRMAPRAPWIEQEGPEYWDRETQISKTNTQTYRESLRNLRGYYNQSEAGSHTLQ\r\nRMYGCDVGPDGRLLRGHDQSAYDGKDYIALNEDLSSWTAADTAAQITQRKWEAAREAEQW\r\nRAYLEGLCVEWLRRYLENGKETLQRADPPKTHVTHHPI