(4534, 'P03989', '1B27_HUMAN', '1986-10-23', '2014-02-19', 'Eukaryota', '362 AA', ' Evidence at protein level;\r\n', ' Membrane; Single-pass type I membrane\r\n protein.\r\n-!- PTM: Polyubiquitinated in a post ER compartment by interaction\r\n with human herpesvirus 8 MIR1 protein. This targets the protein\r\n for rapid degradation via the ubiquitin system (By similarity).\r\n-!- POLYMORPHISM: The following alleles of B-27 are known:\r\n B*27:01=B*27:05, B*27:02 (B27.2; B-27k; B27e), B*27:03 (B27d),\r\n B*27:04, B*27:06, B*27:07, B*27:08 (B7Qui) and B*27:09 (B27-ci).\r\n The sequence shown is that of B*27:01.\r\n-!- DISEASE: Spondyloarthropathy 1 (SPDA1) [MIM:106300]: A chronic\r\n rheumatic disease with multifactorial inheritance. It includes a\r\n spectrum of related disorders comprising ankylosing spondylitis, a\r\n subset of psoriatic arthritis, reactive arthritis (e.g. Reiter\r\n syndrome), arthritis associated with inflammatory bowel disease\r\n and undifferentiated spondyloarthropathy. These disorders may\r\n occur simultaneously or sequentially in the same patient, probably\r\n representing various phenotypic expressions of the same disease.\r\n Ankylosing spondylitis is the form of rheumatoid arthritis\r\n affecting the spine and is considered the prototype of\r\n seronegative spondyloarthropathies. It produces pain and stiffness\r\n as a result of inflammation of the sacroiliac, intervertebral, and\r\n costovertebral joints. Note=Disease susceptibility is associated\r\n with variations affecting the gene represented in this entry. A\r\n restricted number of HLA-B27 subtypes can be associated with\r\n ankylosing spondylitis and other B27-related diseases, and an\r\n elevated frequency of the B*2702 allele in ankylosing spondylitis\r\n patients is identified. The allele B*2707 seems to have a\r\n protective role some populations because it was found only in the\r\n healthy controls.\r\n-!- SIMILARITY: Belongs to the MHC class I family.\r\n-!- SIMILARITY: Contains 1 Ig-like C1-type (immunoglobulin-like)\r\n domain.\r\n', 'MRVTAPRTLLLLLWGAVALTETWAGSHSMRYFHTSVSRPGRGEPRFITVGYVDDTLFVRF\r\nDSDAASPREEPRAPWIEQEGPEYWDRETQICKAKAQTDREDLRTLLRYYNQSEAGSHTLQ\r\nNMYGCDVGPDGRLLRGYHQDAYDGKDYIALNEDLSSWTAADTAAQITQRKWEAARVAEQL\r\nRAYLEGECVEWLRRYLENGKETLQRADPPKTHVTHHPISDHEATLRCWALGFYPAEITLT\r\nWQRDGEDQTQDTELVETRPAGDRTFQKWAAVVVPSGEEQRYTCHVQHEGLPKPLTLRWEP\r\nSSQSTVPIVGIVAGLAVLAVVVIGAVVAAVMCRRKSSGGKGGSYSQAACSDSAQGSDVSL\r\nTA', '>sp|P03989|1B27_HUMAN \nMRVTAPRTLLLLLWGAVALTETWAGSHSMRYFHTSVSRPGRGEPRFITVGYVDDTLFVRF\r\nDSDAASPREEPRAPWIEQEGPEYWDRETQICKAKAQTDREDLRTLLRYYNQSEAGSHTLQ\r\nNMYGCDVGPDGRLLRGYHQDAYDGKDYIALNEDLSSWTAADTAAQITQRKWEAARVAEQL\r\nRAYLEGECVEWLRRYLENGKETLQRADPPKTHVTHHPISDHEATLRCWALGFYPAEITLT\r\nWQRDGEDQTQDTELVETRPAGDRTFQKWAAVVVPSGEEQRYTCHVQHEGLPKPLTLRWEP\r\nSSQSTVPIVGIVAGLAVLAVVVIGAVVAAVMCRRKSSGGKGGSYSQAACSDSAQGSDVSL\r\nTA'),
