(4546, 'P18464', '1B51_HUMAN', '1990-11-01', '2014-02-19', 'Eukaryota', '362 AA', ' Evidence at protein level;\r\n', ' Membrane; Single-pass type I membrane\r\n protein.\r\n-!- PTM: Polyubiquitinated in a post ER compartment by interaction\r\n with human herpesvirus 8 MIR1 protein. This targets the protein\r\n for rapid degradation via the ubiquitin system (By similarity).\r\n-!- POLYMORPHISM: The following alleles of B-51 are known: B*51:01,\r\n B*51:03, B*51:04, B*51:08 and B*51:24. The sequence shown is that\r\n of B*51:01.\r\n-!- MISCELLANEOUS: There is evidence that HLA-B51 is associated with\r\n susceptibility to Behcet disease. However, it is not certain\r\n whether HLA-B51 itself or a closely linked gene is responsible for\r\n susceptibility. The world distribution of HLA-B51 in healthy\r\n people corresponds to the global distribution of Behcet disease;\r\n in Southern hemisphere countries (Africa, South Pacific, etc.) and\r\n in some parts of Europe, the prevalence of HLA-B51 in healthy\r\n people is low or null, corresponding to a low prevalence of Behcet\r\n disease. The wide variation that exists in the relative risk of\r\n HLA-B51 would support other nongenetic risk factors.\r\n-!- SIMILARITY: Belongs to the MHC class I family.\r\n-!- SIMILARITY: Contains 1 Ig-like C1-type (immunoglobulin-like)\r\n domain.\r\n', 'MRVTAPRTVLLLLWGAVALTETWAGSHSMRYFYTAMSRPGRGEPRFIAVGYVDDTQFVRF\r\nDSDAASPRTEPRAPWIEQEGPEYWDRNTQIFKTNTQTYRENLRIALRYYNQSEAGSHTWQ\r\nTMYGCDVGPDGRLLRGHNQYAYDGKDYIALNEDLSSWTAADTAAQITQRKWEAAREAEQL\r\nRAYLEGLCVEWLRRHLENGKETLQRADPPKTHVTHHPVSDHEATLRCWALGFYPAEITLT\r\nWQRDGEDQTQDTELVETRPAGDRTFQKWAAVVVPSGEEQRYTCHVQHEGLPKPLTLRWEP\r\nSSQSTIPIVGIVAGLAVLAVVVIGAVVATVMCRRKSSGGKGGSYSQAASSDSAQGSDVSL\r\nTA', '>sp|P18464|1B51_HUMAN \nMRVTAPRTVLLLLWGAVALTETWAGSHSMRYFYTAMSRPGRGEPRFIAVGYVDDTQFVRF\r\nDSDAASPRTEPRAPWIEQEGPEYWDRNTQIFKTNTQTYRENLRIALRYYNQSEAGSHTWQ\r\nTMYGCDVGPDGRLLRGHNQYAYDGKDYIALNEDLSSWTAADTAAQITQRKWEAAREAEQL\r\nRAYLEGLCVEWLRRHLENGKETLQRADPPKTHVTHHPVSDHEATL