(4649, 'P34968', '5HT2C_MOUSE', '1994-02-01', '2014-02-19', 'Eukaryota', '459 AA', ' Evidence at transcript level;\r\n', ' Cell membrane; Multi-pass membrane protein.\r\n-!- TISSUE SPECIFICITY: Detected in brain cortex, hypothalamus,\r\n brainstem and arcuate nucleus. Detected in the paraventricular\r\n nucleus of the hypothalamus.\r\n-!- DOMAIN: The PDZ domain-binding motif is involved in the\r\n interaction with MPDZ (By similarity).\r\n-!- PTM: N-glycosylated (By similarity).\r\n-!- DISRUPTION PHENOTYPE: No obvious phenotype at birth, but mutant\r\n mice are prone to sudden death from seizures. When fed ad libitum,\r\n adult mice display higher body weight and increased adiposity\r\n compared to wild-type littermates. No difference in body weight is\r\n found when they receive the same amount of food as their wild-type\r\n littermates, indicating that the increased body weight is due to\r\n altered feeding behavior. Overweight older mice develop insulin\r\n resistance and impaired glucose tolerance. Young mice exibit\r\n insulin resistance, but normal glucose tolerance, due to increased\r\n insulin levels in the blood. Insulin resistance is reversed when\r\n Htr2c expression is restored in pro-opiomelacortin neurons. Mutant\r\n mice display impaired activation of pro-opiomelacortin neurons in\r\n the paraventricular nucleus of the hypothalamus, leading to\r\n decreased release of CRH and corticosterone. Likewise, they\r\n exhibit blunted behavorial responses to anxiogenic environments\r\n and stress.\r\n-!- SIMILARITY: Belongs to the G-protein coupled receptor 1 family.\r\n', 'MVNLGTAVRSLLVHLIGLLVWQFDISISPVAAIVTDTFNSSDGGRLFQFPDGVQNWPALS\r\nIVVIIIMTIGGNILVIMAVSMEKKLHNATNYFLMSLAIADMLVGLLVMPLSLLAILYDYV\r\nWPLPRYLCPVWISLDVLFSTASIMHLCAISLDRYVAIRNPIEHSRFNSRTKAIMKIAIVW\r\nAISIGVSVPIPVIGLRDESKVFVNNTTCVLNDPNFVLIGSFVAFFIPLTIMVITYFLTIY\r\nVLRRQTLMLLRGHTEEELRNISLNFLKCCCKKGDEEENAPNPNPDQKPRRKKKEKRPRGT\r\nMQAINNEKKASKVLGIVFFVFLIMWCPFFITNILSVLCGKACNQKLMEKLLNVFVWIGYV\r\nCSGINPLVY