(4727, 'P01009', 'A1AT_HUMAN', '1986-07-21', '2014-02-19', 'Eukaryota', '418 AA', ' Evidence at protein level;\r\n', ' Short peptide from AAT: Secreted,\r\n extracellular space, extracellular matrix.\r\n-!- ALTERNATIVE PRODUCTS:\r\n Event=Alternative splicing; Named isoforms=3;\r\n Name=1;\r\nIsoId=P01009-1; Sequence=Displayed;\r\n Name=2;\r\nIsoId=P01009-2; Sequence=VSP_028889;\r\nNote=No experimental confirmation available;\r\n Name=3;\r\nIsoId=P01009-3; Sequence=VSP_028890;\r\nNote=No experimental confirmation available. May be produced at\r\nvery low levels due to a premature stop codon in the mRNA,\r\nleading to nonsense-mediated mRNA decay;\r\n-!- TISSUE SPECIFICITY: Ubiquitous. Expressed in leukocytes and\r\n plasma.\r\n-!- DOMAIN: The reactive center loop (RCL) extends out from the body\r\n of the protein and directs binding to the target protease. The\r\n protease cleaves the serpin at the reactive site within the RCL,\r\n establishing a covalent linkage between the carboxyl group of the\r\n serpin reactive site and the serine hydroxyl of the protease. The\r\n resulting inactive serpin-protease complex is highly stable.\r\n-!- PTM: N-glycosylated. Differential glycosylation produces a number\r\n of isoforms. N-linked glycan at Asn-107 is alternatively di-\r\n antennary, tri-antennary or tetra-antennary. The glycan at Asn-70\r\n is di-antennary with trace amounts of tri-antennary. Glycan at\r\n Asn-271 is exclusively di-antennary. Structure of glycans at Asn-\r\n 70 and Asn-271 is Hex5HexNAc4. The structure of the antennae is\r\n Neu5Ac(alpha1-6)Gal(beta1-4)GlcNAc attached to the core structure\r\n Man(alpha1-6)[Man(alpha1-3)]Man(beta1-4)GlcNAc(beta1-4)GlcNAc.\r\n Some antennae are fucosylated, which forms a Lewis-X determinant.\r\n-!- PTM: Proteolytic processing may yield the truncated form that\r\n ranges from Asp-30 to Lys-418.\r\n-!- POLYMORPHISM: The sequence shown is that of the M1V allele which\r\n is the most common form of PI (44 to 49%). Other frequent alleles\r\n are: M1A 20 to 23%; M2 10 to 11%; M3 14 to 19%.\r\n-!- DISEASE: Alpha-1-antitrypsin deficiency (A1ATD) [MIM:613490]: A\r\n disorder whose most common manifestation is emphysema, which\r\n becomes evident by the third to fourth decade. A less common\r\n manifestation of the deficiency is liver disease, which occurs in\r\n children and adults, and may result in cirrhosis and liver\r\n failure. Environmental factors, particularly cigarette smoking,\r\n greatly increase the risk of emphysema at an earlier age. Note=The\r\n disease is caused by mutations affecting the gene represented in\r\n this entry.\r\n-!- MISCELLANEOUS: The aberrant form is found in the plasma of chronic\r\n smokers, and persists after smoking is ceased. It can still be\r\n found ten years after smoking has ceased.\r\n-!- SIMILARITY: Belongs to the serpin family.\r\n-!- SEQUENCE CAUTION:\r\n Sequence=CAD62334.1; Type=Erroneous initiation; Note=Translation N-terminally shortened;\r\n Sequence=CAD62585.1; Type=Erroneous initiation; Note=Translation N-terminally shortened;\r\n-!- WEB RESOURCE: Name=GeneReviews;\r\n URL="http://www.ncbi.nlm.nih.gov/gtr/tests/?term=SERPINA1[gene]";\r\n-!- WEB RESOURCE: Name=Wikipedia; Note=Alpha-1 antitrypsin entry;\r\n URL="http://en.wikipedia.org/wiki/Alpha_1-antitrypsin";\r\n', 'MPSSVSWGILLLAGLCCLVPVSLAEDPQGDAAQKTDTSHHDQDHPTFNKITPNLAEFAFS\r\nLYRQLAHQSNSTNIFFSPVSIATAFAMLSLGTKADTHDEILEGLNFNLTEIPEAQIHEGF\r\nQELLRTLNQPDSQLQLTTGNGLFLSEGLKLVDKFLEDVKKLYHSEAFTVNFGDTEEAKKQ\r\nINDYVEKGTQGKIVDLVKELDRDTVFALVNYIFFKGKWERPFEVKDTEEEDFHVDQVTTV\r\nKVPMMKRLGMFNIQHCKKLSSWVLLMKYLGNATAIFFLPDEGKLQHLENELTHDIITKFL\r\nENEDRRSASLHLPKLSITGTYDLKSVLGQLGITKVFSNGADLSGVTEEAPLKLSKAVHKA\r\nVLTIDEKGTEAAGAMFLEAIPMSIPPEVKFNKPFVFLMIEQNTKSPLFMGKVVNPTQK', '>sp|P01009|A1AT_HUMAN \nMPSSVSWGILLLAGLCCLVPVSLAEDPQGDAAQKTDTSHHDQDHPTFNKITPNLAEFAFS\r\nLYRQLAHQSNSTNIFFSPVSIATAFAMLSLGTKADTHDEILEGLNFNLTEIPEAQIHEGF\r\nQELLRTLNQPDSQLQLTTGNGLFLSEGLKLVDKFLEDVKKLYHSEAFTVNFGDTEEAKKQ\r\nINDYVEKGTQGKIVDLVKELDRD