(4779, 'P14599', 'A4_DROME', '1990-04-01', '2014-02-19', 'Eukaryota', '887 AA', ' Evidence at protein level;\r\n', ' Membrane; Single-pass type I membrane\r\n protein.\r\n-!- TISSUE SPECIFICITY: Expressed in postmitotic neurons in the\r\n central and peripheral nervous systems. Within the nervous system,\r\n transcripts are not observed in neuroblasts, newly generated\r\n neurons and at least one class of presumed glial cells.\r\n-!- DEVELOPMENTAL STAGE: Expressed in all developmental stages.\r\n-!- DOMAIN: The clathrin-binding site is essential for its association\r\n with X11-alpha, -beta, and -gamma. The sequence specific\r\n recognition extends to peptide residues that are C-terminal to the\r\n NPXY motif. This interaction appears to be independent of\r\n phosphorylation (By similarity).\r\n-!- DISRUPTION PHENOTYPE: Overexpression inhibits the Nedd8\r\n conjugation pathway, disrupts the normal bristle pattern in the\r\n fly thorax, and induces apoptosis in wing imaginal disks.\r\n-!- SIMILARITY: Belongs to the APP family.\r\n-!- CAUTION: Was originally (PubMed:2494667) thought to be vnd but\r\n further analysis (PubMed:2127912) has clearly shown that it\r\n corresponds to Appl.\r\n', 'MCAALRRNLLLRSLWVVLAIGTAQVQAASPRWEPQIAVLCEAGQIYQPQYLSEEGRWVTD\r\nLSKKTTGPTCLRDKMDLLDYCKKAYPNRDITNIVESSHYQKIGGWCRQGALNAAKCKGSH\r\nRWIKPFRCLGPFQSDALLVPEGCLFDHIHNASRCWPFVRWNQTGAAACQERGMQMRSFAM\r\nLLPCGISVFSGVEFVCCPKHFKTDEIHVKKTDLPVMPAAQINSANDELVMNDEDDSNDSN\r\nYSKDANEDDLDDEDDLMGDDEEDDMVADEAATAGGSPNTGSSGDSNSGSLDDINAEYDSG\r\nEEGDNYEEDGAGSESEAEVEASWDQSGGAKVVSLKSDSSSPSSAPVAPAPEKAPVKSESV\r\nTSTPQLSASAAAFVAANSGNSGTGAGAPPSTAQPTSDPYFTHFDPHYEHQSYKVSQKRLE\r\nESHREKVTRVMKDWSDLEEKYQDMRLADPKAAQSFKQRMTARFQTSVQALEEEGNAEKHQ\r\nLAAMHQQRVLAHINQRKREAMTCYTQALTEQPPNAHHVEKCLQKLLRALHKDRAHALAHY\r\nRHLLNSGGPGGLEAAASERPRTLERLIDIDRAVNQSMTMLKRYPELSAKIAQLMNDYILA\r\nLRSKDDIPGSSLGMSEEAEAGILDKYRVEIERKVAEKERLRLAEKQRKEQRAAEREKLRE\r\nEKLRLEAKKVDDMLKSQVAEQQSQPTQSSTQSQAQQQQQEKSLPGKELGPDAALVTAANP\r\nNLETTKSEKDLSDTEYGEATVSSTKVQTVLPTVDDDAVQRAVEDVAAAVAHQEAEPQVQH\r\nFMTHDLGHRESSFSLRREFAQHAHAAKEGRNVYFTLSFAGIALMAAVFVGVAVAKWRTSR\r\nSPHAQGFIEVDQNVTTHHPIVREEKIVPNMQINGYENPTYKYFEVKE', '>sp|P14599|A4_DROME \nMCAALRRNLLLRSLWVVLAIGTAQVQAASPRWEPQIAVLCEAGQIYQPQYLSEEGRWVTD\r\nLSKKTTGPTCLRDKMDLLDYCKKAYPNRDITNIVESSHYQKIGGWCRQGALNAAKCKGSH\r\nRWIKPFRCLGPFQSDALLVPEGCLFDHIHNASRCWPFVRWNQTGAAACQERGMQMRSFAM\r\nLLPCGISVFSGVEFVCCPKHFKTDEIHVKKTDLPVMPAAQINSANDELVMNDEDDSNDSN\r\nYSKDANEDDLDDEDDLMGDDEEDDMVADEAATAGGSPNTGSSGDSNSGSLDDINAEYDSG\r\nEEGDNYEEDGAGSESEAEVEASWDQSGGAKVVSLKSDSSSPSSAPVAPAPEKAPVKSESV\r\nTSTPQLSASAAAFVAANSGNSGTGAGAPPSTAQPTSDPYFTHFDPHYEHQSYKVSQKRLE\r\nESHREKVTRVMKDWSDLEEKYQDMRLADPKAAQSFKQRMTARFQTSVQALEEEGNAEKHQ\r\nLAAMHQQRVLAHINQRKREAMTCYTQALTEQPPNAHHVEKCLQKLLRALHKDRAHALAHY\r\nRHLLNSGGPGGLEAAASERPRTLERLIDIDRAVNQSMTMLKRYPELSAKIAQLMNDYILA\r\nLRSKDDIPGSSLGMSEEAEAGILDKYRVEIERKVAEKERLRLAEKQRKEQRAAEREKLRE\r\nEKLRLEAKKVDDMLKSQVAEQQSQPTQSSTQSQAQQQQQEKSLPGKELGPDAALVTAANP\r\nNLETTKSEKDLSDTEYGEATVSSTKVQTVLPTVDDDAVQRAVEDVAAAVAHQEAEPQVQH\r\nFMTHDLGHRESSFSLRREFAQHAHAAKEGRNVYFTLSFAGIALMAAVFVGVAVAKWRTSR\r\nSPHAQGFIEVDQNVTTHHPIVREEKIVPNMQINGYENPTYKYFEVKE'),
(4780, 'P53601', 'A4_MACFA', '1996-10-01', '2014-02-19', 'Eukaryota', '770 AA', ' Evidence at transcript level;\r\n', ' Membrane; Single-pass type I membrane\r\n protein (By similarity). Membrane, clathrin-coated pit (By\r\n similarity). Note=Cell surface protein that rapidly becomes\r\n internalized via clathrin-coated pits. During maturation, the\r\n immature APP (N-glycosylated in the endoplasmic reticulum) moves\r\n to the Golgi complex where complete maturation occurs (O-\r\n glycosylated and sulfated). After alpha-secretase cleavage,\r\n soluble APP is released into the extracellular space and the C-\r\n terminal is internalized to endosomes and lysosomes. Some APP\r\n accumulates in secretory transport vesicles leaving the late Golgi\r\n compartment and returns to the cell surface. Gamma-CTF(59) peptide\r\n is located to both the cytoplasm and nuclei of neurons. Associates\r\n with GPC1 in perinuclear compartments (By similarity).\r\n-!- ALTERNATIVE PRODUCTS:\r\n Event=Alternative splicing; Named isoforms=3;\r\nComment=Additional isoforms seem to exist;\r\n Name=APP770;\r\nIsoId=P53601-1; Sequence=Displayed;\r\n Name=APP695;\r\nIsoId=P53601-2; Sequence=VSP_000010, VSP_000011;\r\n Name=3;\r\nIsoId=P53601-3; Sequence=VSP_013360, VSP_013361;\r\n-!- DOMAIN: The basolateral sorting signal (BaSS) is required for\r\n sorting of membrane proteins to the basolateral surface of\r\n epithelial cells (By similarity).\r\n-!- DOMAIN: The NPXY sequence motif found in many tyrosine-\r\n phosphorylated proteins is required for the specific binding of\r\n the PID domain. However, additional amino acids either N- or C-\r\n terminal to the NPXY motif are often required for complete\r\n interaction. The PID domain-containing proteins which bind APP\r\n require the YENPTY motif for full interaction. These interactions\r\n are independent of phosphorylation on the terminal tyrosine\r\n residue. The NPXY site is also involved in clathrin-mediated\r\n endocytosis (By similarity).\r\n-!- PTM: Proteolytically processed under normal cellular conditions.\r\n Cleavage either by alpha-secretase, beta-secretase or theta-\r\n secretase leads to generation and extracellular release of soluble\r\n APP peptides, S-APP-alpha and S-APP-beta, and the retention of\r\n corresponding membrane-anchored C-terminal fragments, C80, C83 and\r\n C99. Subsequent processing of C80 and C83 by gamma-secretase\r\n yields P3 peptides. This is the major secretory pathway and is\r\n non-amyloidogenic. Alternatively, presenilin/nicastrin-mediated\r\n gamma-secretase processing of C99 releases the amyloid beta\r\n proteins, amyloid-beta 40 (Abeta40) and amyloid-beta 42 (Abeta42),\r\n major components of amyloid plaques, and the cytotoxic C-terminal\r\n fragments, gamma-CTF(50), gamma-CTF(57) and gamma-CTF(59) (By\r\n similarity).\r\n-!- PTM: Proteolytically cleaved by caspases during neuronal apoptosis\r\n (By similarity). Cleavage at Asp-739 by either caspase-3, -8 or -9\r\n results in the production of the neurotoxic C31 peptide and the\r\n increased production of beta-amyloid peptides (By similarity).\r\n-!- PTM: N- and O-glycosylated (By similarity).\r\n-!- PTM: Phosphorylation in the C-terminal on tyrosine, threonine and\r\n serine residues is neuron-specific. Phosphorylation can affect APP\r\n processing, neuronal differentiation and interaction with other\r\n proteins (By similarity).\r\n-!- PTM: Trophic-factor deprivation triggers the cleavage of surface\r\n APP by beta-secretase to release sAPP-beta which is further\r\n cleaved to release an N-terminal fragment of APP (N-APP) (By\r\n similarity).\r\n-!- PTM: Beta-amyloid peptides are degraded by IDE (By similarity).\r\n-!- MISCELLANEOUS: Chelation of metal ions, notably copper, iron and\r\n zinc, can induce histidine-bridging between beta-amyloid molecules\r\n resulting in beta-amyloid-metal aggregates (By similarity).\r\n Extracellular zinc-binding increases binding of heparin to APP and\r\n inhibits collagen-binding (By similarity).\r\n-!- SIMILARITY: Belongs to the APP family.\r\n-!- SIMILARITY: Contains 1 BPTI/Kunitz inhibitor domain.\r\n', 'MLPGLALLLLAAWTARALEVPTDGNAGLLAEPQIAMFCGRLNMHMNVQNGKWDSDPSGTK\r\nTCIDTKEGILQYCQEVYPELQITNVVEANQPVTIQNWCKRGRKQCKTHPHFVIPYRCLVG\r\nEFVSDALLVPDKCKFLHQERMDVCETHLHWHTVAKETCSEKSTNLHDYGMLLPCGIDKFR\r\nGVEFVCCPLAEESDNVDSADAEEDDSDVWWGGADTDYADGSEDKVVEVAEEEEVAEVEEE\r\nEADDDEDDEDGDEVEEEAEEPYEEATERTTSIATTTTTTTESVEEVVREVCSEQAETGPC\r\nRAMISRWYFDVTEGKCAPFFYGGCGGNRNNFDTEEYCMAVCGSVMSQSLRKTTREPLTRD\r\nPVKLPTTAASTPDAVDKYLETPGDENEHAHFQKAKERLEAKHRERMSQVMREWEEAERQA\r\nKNLPKADKKAVIQHFQEKVESLEQEAANERQQLVETHMARVEAMLNDRRRLALENYITAL\r\nQAVPPRPRHVFNMLKKYVRAEQKDRQHTLKHFEHVRMVDPKKAAQIRSQVMTHLRVIYER\r\nMNQSLSLLYNVPAVAEEIQDEVDELLQKEQNYSDDVLANMISEPRISYGNDALMPSLTET\r\nKTTVELLPVNGEFSLDDLQPWHSFGADSVPANTENEVEPVDARPAADRGLTTRPGSGLTN\r\nIKTEEISEVKMDAEFRHDSGYEVHHQKLVFFAEDVGSNKGAIIGLMVGGVVIATVIVITL\r\nVMLKKKQYTSIHHGVVEVDAAVTPEERHLSKMQQNGYENPTYKFFEQMQN', '>sp|P53601|A4_MACFA \nMLPGLALLLLAAWTARALEVPTDGNAGLLAEPQIAMFCGRLNMHMNVQNGKWDSDPSGTK\r\nTCIDTKEGILQYCQEVYPELQITNVVEANQPVTIQNWCKRGRKQCKTHPHFVIPYRCLVG\r\nEFVSDALLVPDKCKFLHQERMDVCETHLHWHTVAKETCSEKSTNLHDYGMLLPCGIDKFR\r\nGVEFVCCPLAEESDNVDSADAEEDDSDVWWGGADTDYADGSEDKVVEVAEEEEVAEVEEE\r\nEADDDEDDEDGDEVEEEAEEPYEEATERTTSIATTTTTTTESVEEVVREVCSEQAETGPC\r\nRAMISRWYFDVTEGKCAPFFYGGCGGNRNNFDTEEYCMAVCGSVMSQSLRKTTREPLTRD\r\nPVKLPTTAASTPDAVDKYLETPGDENEHAHFQKAKERLEAKHRERMSQVMREWEEAERQA\r\nKNLPKADKKAVIQHFQEKVESLEQEAANERQQLVETHMARVEAMLNDRRRLALENYITAL\r\nQAVPPRPRHVFNMLKKYVRAEQKDRQHTLKHFEHVRMVDPKKAAQIRSQVMTHLRVIYER\r\nMNQSLSLLYNVPAVAEEIQDEVDELLQKEQNYSDDVLANMISEPRISYGNDALMPSLTET\r\nKTTVELLPVNGEFSLDDLQPWHSFGADSVPANTENEVEPVDARPAADRGLTTRPGSGLTN\r\nIKTEEISEVKMDAEFRHDSGYEVHHQKLVFFAEDVGSNKGAIIGLMVGGVVIATVIVITL\r\nVMLKKKQYTSIHHGVVEVDAAVTPEERHLSKMQQNGYENPTYKFFEQMQN'),
(4781, 'P12023', 'A4_MOUSE', '1989-10-01', '2014-02-19', 'Eukaryota', '770 AA', ' Evidence at protein level;\r\n', ' Membrane; Single-pass type I membrane\r\n protein. Membrane, clathrin-coated pit. Note=Cell surface protein\r\n that rapidly becomes internalized via clathrin-coated pits. During\r\n maturation, the immature APP (N-glycosylated in the endoplasmic\r\n reticulum) moves to the Golgi complex where complete maturation\r\n occurs (O-glycosylated and sulfated). After alpha-secretase\r\n cleavage, soluble APP is released into the extracellular space and\r\n the C-terminal is internalized to endosomes and lysosomes. Some\r\n APP accumulates in secretory transport vesicles leaving the late\r\n Golgi compartment and returns to the cell surface. Gamma-CTF(59)\r\n peptide is located to both the cytoplasm and nuclei of neurons. It\r\n can be translocated to the nucleus through association with APBB1\r\n (Fe65). Beta-APP42 associates with FPRL1 at the cell surface and\r\n the complex is then rapidly internalized (By similarity). APP\r\n sorts to the basolateral surface in epithelial cells (By\r\n similarity). During neuronal differentiation, the Thr-743\r\n phosphorylated form is located mainly in growth cones, moderately\r\n in neurites and sparingly in the cell body. Casein kinase\r\n phosphorylation can occur either at the cell surface or within a\r\n post-Golgi compartment. Associates with GPC1 in perinuclear\r\n compartments.\r\n-!- ALTERNATIVE PRODUCTS:\r\n Event=Alternative splicing; Named isoforms=4;\r\nComment=Additional isoforms seem to exist;\r\n Name=APP770;\r\nIsoId=P12023-1; Sequence=Displayed;\r\n Name=APP695;\r\nIsoId=P12023-2; Sequence=VSP_000012, VSP_000013;\r\n Name=APP751;\r\nIsoId=P12023-3; Sequence=VSP_000014;\r\n Name=APP714;\r\nIsoId=P12023-4; Sequence=Not described;\r\n-!- TISSUE SPECIFICITY: Isoform APP770 is expressed in kidney. Isoform\r\n APP751 is widely expressed. Isoform APP695 is expressed in brain,\r\n kidney and liver. Isoform APP695, isoform APP714 and isoform\r\n APP751 are expressed in several different brain regions including\r\n hippocampus, substania nigra pars compacta and cerebellum. In the\r\n cerebellum, these isoforms are abundantly expressed in Purkinje\r\n cells.\r\n-!- DOMAIN: The basolateral sorting signal (BaSS) is required for\r\n sorting of membrane proteins to the basolateral surface of\r\n epithelial cells.\r\n-!- DOMAIN: The NPXY sequence motif found in many tyrosine-\r\n phosphorylated proteins is required for the specific binding of\r\n the PID domain. However, additional amino acids either N- or C-\r\n terminal to the NPXY motif are often required for complete\r\n interaction. The PID domain-containing proteins which bind APP\r\n require the YENPTY motif for full interaction. These interactions\r\n are independent of phosphorylation on the terminal tyrosine\r\n residue. The NPXY site is also involved in clathrin-mediated\r\n endocytosis (By similarity).\r\n-!- PTM: Proteolytically processed under normal cellular conditions.\r\n Cleavage either by alpha-secretase, beta-secretase or theta-\r\n secretase leads to generation and extracellular release of soluble\r\n APP peptides, S-APP-alpha and S-APP-beta, and the retention of\r\n corresponding membrane-anchored C-terminal fragments, C80, C83 and\r\n C99. Subsequent processing of C80 and C83 by gamma-secretase\r\n yields P3 peptides. This is the major secretory pathway and is\r\n non-amyloidogenic. Alternatively, presenilin/nicastrin-mediated\r\n gamma-secretase processing of C99 releases the amyloid beta\r\n proteins, amyloid-beta 40 (Abeta40) and amyloid-beta 42 (Abeta42),\r\n major components of amyloid plaques, and the cytotoxic C-terminal\r\n fragments, gamma-CTF(50), gamma-CTF(57) and gamma-CTF(59) (By\r\n similarity).\r\n-!- PTM: Proteolytically cleaved by caspases during neuronal\r\n apoptosis. Cleavage at Asp-739 by either caspase-3, -8 or -9\r\n results in the production of the neurotoxic C31 peptide and the\r\n increased production of beta-amyloid peptides (By similarity).\r\n-!- PTM: N- and O-glycosylated (By similarity).\r\n-!- PTM: Phosphorylation in the C-terminal on tyrosine, threonine and\r\n serine residues is neuron-specific. Phosphorylation can affect APP\r\n processing, neuronal differentiation and interaction with other\r\n proteins. The Thr-743 phosphorylated form causes a conformational\r\n change which reduces binding of Fe65 family members (By\r\n similarity). Phosphorylation on Tyr-757 is required for SHC\r\n binding (By similarity).\r\n-!- PTM: Extracellular binding and reduction of copper, results in a\r\n corresponding oxidation of Cys-144 and Cys-158, and the formation\r\n of a disulfide bond (By similarity).\r\n-!- PTM: Trophic-factor deprivation triggers the cleavage of surface\r\n APP by beta-secretase to release sAPP-beta which is further\r\n cleaved to release an N-terminal fragment of APP (N-APP) (By\r\n similarity).\r\n-!- PTM: Beta-amyloid peptides are degraded by IDE (By similarity).\r\n-!- MISCELLANEOUS: Chelation of metal ions, notably copper, iron and\r\n zinc, can induce histidine-bridging between beta-amyloid molecules\r\n resulting in beta-amyloid-metal aggregates. Rat and mouse beta-\r\n amyloid peptides have an arginine residue substituted for the\r\n bridging histidine residue and are thus less capable of forming\r\n amyloid aggregates. Extracellular zinc-binding increases binding\r\n of heparin to APP and inhibits collagen-binding (By similarity).\r\n-!- SIMILARITY: Belongs to the APP family.\r\n-!- SIMILARITY: Contains 1 BPTI/Kunitz inhibitor domain.\r\n', 'MLPSLALLLLAAWTVRALEVPTDGNAGLLAEPQIAMFCGKLNMHMNVQNGKWESDPSGTK\r\nTCIGTKEGILQYCQEVYPELQITNVVEANQPVTIQNWCKRGRKQCKTHTHIVIPYRCLVG\r\nEFVSDALLVPDKCKFLHQERMDVCETHLHWHTVAKETCSEKSTNLHDYGMLLPCGIDKFR\r\nGVEFVCCPLAEESDSVDSADAEEDDSDVWWGGADTDYADGGEDKVVEVAEEEEVADVEEE\r\nEADDDEDVEDGDEVEEEAEEPYEEATERTTSTATTTTTTTESVEEVVREVCSEQAETGPC\r\nRAMISRWYFDVTEGKCVPFFYGGCGGNRNNFDTEEYCMAVCGSVSTQSLLKTTSEPLPQD\r\nPDKLPTTAASTPDAVDKYLETPGDENEHAHFQKAKERLEAKHRERMSQVMREWEEAERQA\r\nKNLPKADKKAVIQHFQEKVESLEQEAANERQQLVETHMARVEAMLNDRRRLALENYITAL\r\nQAVPPRPHHVFNMLKKYVRAEQKDRQHTLKHFEHVRMVDPKKAAQIRSQVMTHLRVIYER\r\nMNQSLSLLYNVPAVAEEIQDEVDELLQKEQNYSDDVLANMISEPRISYGNDALMPSLTET\r\nKTTVELLPVNGEFSLDDLQPWHPFGVDSVPANTENEVEPVDARPAADRGLTTRPGSGLTN\r\nIKTEEISEVKMDAEFGHDSGFEVRHQKLVFFAEDVGSNKGAIIGLMVGGVVIATVIVITL\r\nVMLKKKQYTSIHHGVVEVDAAVTPEERHLSKMQQNGYENPTYKFFEQMQN', '>sp|P12023|A4_MOUSE \nMLPSLALLLLAAWTVRALEVPTDGNAGLLAEPQIAMFCGKLNMHMNVQNGKWESDPSGTK\r\nTCIGTKEGILQYCQEVYPELQITNVVEANQPVTIQNWCKRGRKQCKTHTHIVIPYRCLVG\r\nEFVSDALLVPDKCKFLHQERMDVCETHLHWHTVAKETCSEKSTNLHDYGMLLPCGIDKFR\r\nGVEFVCCPLAEESDSVDSADAEEDDSDVWWGGADTDYADGGEDKVVEVAEEEEVADVEEE\r\nEADDDEDVEDGDEVEEEAEEPYEEATERTTSTATTTTTTTESVEEVVREVCSEQAETGPC\r\nRAMISRWYFDVTEGKCVPFFYGGCGGNRNNFDTEEYCMAVCGSVSTQSLLKTTSEPLPQD\r\nPDKLPTTAASTPDAVDKYLETPGDENEHAHFQKAKERLEAKHRERMSQVMREWEEAERQA\r\nKNLPKADKKAVIQHFQEKVESLEQEAANERQQLVETHMARVEAMLNDRRRLALENYITAL\r\nQAVPPRPHHVFNMLKKYVRAEQKDRQHTLKHFEHVRMVDPKKAAQIRSQVMTHLRVIYER\r\nMNQSLSLLYNVPAVAEEIQDEVDELLQKEQNYSDDVLANMISEPRISYGNDALMPSLTET\r\nKTTVELLPVNGEFSLDDLQPWHPFGVDSVPANTENEVEPVDARPAADRGLTTRPGSGLTN\r\nIKTEEISEVKMDAEFGHDSGFEVRHQKLVFFAEDVGSNKGAIIGLMVGGVVIATVIVITL\r\nVMLKKKQYTSIHHGVVEVDAAVTPEERHLSKMQQNGYENPTYKFFEQMQN');
